var mongoCollection *mongo.Collection
var conf *config.Config

func TestMain(m *testing.M) {
	// read config
	log.Print("Loading default configurations for test.")
	conf = config.Load("../../configs")
	conf.Api.Pagination.LimitMax = 2

	// setup mongodb connection
	log.Printf("Setup mongodb connection.")
	clientOptions := options.Client().ApplyURI(config.GenerateMongoUrl(&conf.MongoDB)).
		SetAuth(options.Credential{
			Username: conf.MongoDB.User,
			Password: conf.MongoDB.Pass,
		})
	// mongodb client
	client, err := mongo.Connect(context.TODO(), clientOptions)
	if err != nil {
		log.Errorf("Unable to connect to mongodb. Some tests may fail. Error: %v", err)
	}
	mongoCollection = client.Database(conf.MongoDB.Name).Collection(conf.MongoDB.Collections["listings"])
	isMongoHealth := mongoHealth(context.Background(), mongoCollection)
	log.Println("Is mongodb healthy to run tests ? ", isMongoHealth)

	code := m.Run()
	os.Exit(code)
}

func mongoHealth(ctx context.Context, collection *mongo.Collection) bool {
	response := &pb.HealthResponse{}
	runCmdOpts := &options.RunCmdOptions{ReadPreference: readpref.Nearest(readpref.WithMaxStaleness(90 * time.Second))}

	err := collection.Database().RunCommand(ctx, bsonx.Doc{{"ping", bsonx.String("1")}}, runCmdOpts).Decode(&response)
	if err != nil {
		log.Errorf("Error while pinging mongodb for health check : %v", err)
	} else {
		return true
	}
	return false
}

