func TestIntegrationGetMlsListingByListingId(t *testing.T) {

	// connection to server
	conn, err := grpc.Dial(fmt.Sprintf("localhost:%d", port), grpc.WithInsecure())
	if err != nil {
		log.Fatalf("Unable to connect: %v", err)
	}
	defer conn.Close()
	client := pb.NewMlsListingServiceClient(conn)

	ctx, cancel := context.WithTimeout(context.Background(), time.Second)
	defer cancel()

	// response json
	testListingJson := CABCREIS493278
	testListings := &pb.GetMlsListingByListingIdResponse{}
	err1 := jsonpb.Unmarshal(strings.NewReader(testListingJson), testListings)
	if err1 != nil {
		log.Error("Error in test list: ", err1)
	}

	// 1. Listing By ListingId
	request := &pb.GetMlsListingByListingIdRequest{ListingId: "493278"}
	response, err := client.GetMlsListingByListingId(ctx, request)
	assert.Nil(t, err)
	assert.NotNil(t, response)
	assert.Equal(t, 1, len(response.MlsListings))
	AssertElementsMatch(t, response.MlsListings, testListings.MlsListings)
	assert.Equal(t, "true", response.MlsListings[0].Property.Equipment.Excludes)
	assert.Equal(t, "true", response.MlsListings[0].Property.Equipment.GreenFeatures.EnergyEfficient)
	assert.Equal(t, "true", response.MlsListings[0].Property.Characteristics.GreenFeatures.EnergyGeneration)
	assert.Equal(t, "true", response.MlsListings[0].Property.Characteristics.GreenFeatures.IndoorAirQuality)
	assert.Equal(t, "true", response.MlsListings[0].Property.Characteristics.GreenFeatures.Location)
	assert.Equal(t, "true", response.MlsListings[0].Property.Characteristics.GreenFeatures.Sustainability)
	assert.Equal(t, "true", response.MlsListings[0].Property.Characteristics.GreenFeatures.WaterConservation)
	assert.Equal(t, true, response.MlsListings[0].Property.Listing.Contract.IsHudOwnedDates)
	assert.Nil(t, response.MlsListings[0].Property.Listing.Dates.MlsModificationTimestamp)

	// 2. This should return multiple listings for the given listing id. filter using "postal_code".
	listing1429957 := &pb.GetMlsListingByListingIdResponse{}
	jsonpb.Unmarshal(strings.NewReader(ME_MREIS1429957), listing1429957)
	request2 := &pb.GetMlsListingByListingIdRequest{ListingId: "1429957", PostalCode: "04654"}
	response2, err := client.GetMlsListingByListingId(ctx, request2)
	assert.Nil(t, err)
	assert.NotNil(t, response2)
	assert.Equal(t, 1, len(response2.MlsListings))
	AssertElementsMatch(t, response2.MlsListings, listing1429957.MlsListings)

	// 3. Listing By ListingId with liveStreamOpenHouse
	liveStreamOpenHouseListing := &pb.GetMlsListingByListingIdResponse{}
	jsonpb.Unmarshal(strings.NewReader(OH_CBR_218040162), liveStreamOpenHouseListing)
	request3 := &pb.GetMlsListingByListingIdRequest{ListingId: "218040162"}
	response3, err := client.GetMlsListingByListingId(ctx, request3)
	assert.NotNil(t, response3)
	assert.Equal(t, 1, len(response3.MlsListings))
	AssertElementsMatch(t, response3.MlsListings, liveStreamOpenHouseListing.MlsListings)
	assert.NotNil(t, response3.MlsListings[0].LiveStreamOpenHouse)
	assert.True(t, response3.MlsListings[0].LiveStreamOpenHouse.IsLiveStreamOh)

	// 4. ListingId with hyphen.
	listing10634525 := &pb.GetMlsListingByListingIdResponse{}
	jsonpb.Unmarshal(strings.NewReader(RMLS_RX_10634525), listing10634525)
	request4 := &pb.GetMlsListingByListingIdRequest{ListingId: "RX-10634525"} // actual listing id: RX_10634525. mdp converts hyphen to underscore.
	response4, err := client.GetMlsListingByListingId(ctx, request4)
	assert.Nil(t, err)
	assert.NotNil(t, response4)
	assert.Equal(t, 1, len(response4.MlsListings))
	AssertElementsMatch(t, response4.MlsListings, listing10634525.MlsListings)

	// 5. Case in-sensitive lookup.
	request5 := &pb.GetMlsListingByListingIdRequest{ListingId: "rx-10634525"}
	response5, err := client.GetMlsListingByListingId(ctx, request5)
	assert.Nil(t, err)
	assert.NotNil(t, request5)
	assert.Equal(t, 1, len(response5.MlsListings))
	AssertElementsMatch(t, response5.MlsListings, listing10634525.MlsListings)

	// 6. ListingsBy ID endpoint to lookup listings with underscore "_".
	listing10634526 := &pb.GetMlsListingByListingIdResponse{}
	jsonpb.Unmarshal(strings.NewReader(RMLS_RX_10634526), listing10634526)
	request6 := &pb.GetMlsListingByListingIdRequest{ListingId: "RX-10634526"}
	response6, err := client.GetMlsListingByListingId(ctx, request6)
	assert.Nil(t, err)
	assert.NotNil(t, request6)
	assert.Equal(t, 1, len(response6.MlsListings))
	AssertElementsMatch(t, response6.MlsListings, listing10634526.MlsListings)
}

