func TestIntegrationGetMlsListingBySource(t *testing.T) {

	// connection to server
	conn, err := grpc.Dial(fmt.Sprintf("localhost:%d", port), grpc.WithInsecure())
	if err != nil {
		log.Fatalf("Unable to connect: %v", err)
	}
	defer conn.Close()
	client := pb.NewMlsListingServiceClient(conn)

	ctx, cancel := context.WithTimeout(context.Background(), time.Second)
	defer cancel()

	// test data has more than 1 "BRIGHTMLS" listings.
	// without limit. should use default limit (1).
	request := &pb.GetMlsListingsBySourceRequest{SourceSystemKey: "BRIGHTMLS"}
	response, err := client.GetMlsListingBySource(ctx, request)
	assert.NotNil(t, response)
	assert.Equal(t, 1, len(response.MlsListings)) // Default, "Limit" is set as "1" in the env.

	// with limit (3) greater than allowed maximum limit (2). should use maximum limit (2).
	request2 := &pb.GetMlsListingsBySourceRequest{SourceSystemKey: "BRIGHTMLS", Limit: 3}
	response2, err := client.GetMlsListingBySource(ctx, request2)
	assert.NotNil(t, response2)
	assert.Equal(t, 2, len(response2.MlsListings)) // Maximum "Limit" is set as "2" in the env.

	// with offset(2) and limit (3) which is greater than the allowed maximum limit (2). should use maximum limit (2) from offset (2). should return "1" as there are only 3 "BRIGHTMLS" listings.
	request3 := &pb.GetMlsListingsBySourceRequest{SourceSystemKey: "BRIGHTMLS", Offset: 2, Limit: 3}
	response3, err := client.GetMlsListingBySource(ctx, request3)
	assert.NotNil(t, response3)
	assert.Equal(t, 1, len(response3.MlsListings)) // Maximum "Limit" is set as "2" in the env.
}

func TestIntegrationGetMlsListingBySourceWithLastChangeDate(t *testing.T) {

	// connection to server
	conn, err := grpc.Dial(fmt.Sprintf("localhost:%d", port), grpc.WithInsecure())
	if err != nil {
		log.Fatalf("Unable to connect: %v", err)
	}
	defer conn.Close()
	client := pb.NewMlsListingServiceClient(conn)

	ctx, cancel := context.WithTimeout(context.Background(), time.Second)
	defer cancel()

	// response json
	testListingJson := CABCREIS490266
	testListings := &pb.GetMlsListingsBySourceResponse{}
	jsonpb.Unmarshal(strings.NewReader(testListingJson), testListings)

	// 1. search beyond last 30 days should return error. (default 30 days. config driven)
	lastChangeTs := time.Unix(time.Now().AddDate(0, 0, -32).Unix(), 0).UTC()
	request := &pb.GetMlsListingsBySourceRequest{SourceSystemKey: "AR_TMLS", LastChangeTimestamp: &timestamp.Timestamp{Seconds: lastChangeTs.Unix(), Nanos: 0}}
	response, err := client.GetMlsListingBySource(ctx, request)
	status1, ok := status.FromError(err)
	assert.Nil(t, response)
	assert.True(t, ok)
	assert.NotNil(t, err)
	assert.Equal(t, fmt.Sprintf("Listings cannot be searched beyond last %v days", conf.Api.BySource.AllowedLastChangeDays), status1.Message())
	assert.Equal(t, codes.InvalidArgument, status1.Code())

	// 2. search by "lastChangeDate" should ignore nano's.
	lastChangeTs2 := time.Now().AddDate(0, 0, -31).UTC() // client sends nano's in the timestamp
	request2 := &pb.GetMlsListingsBySourceRequest{SourceSystemKey: "AR_TMLS", LastChangeTimestamp: &timestamp.Timestamp{Seconds: lastChangeTs2.Unix(), Nanos: 0}}
	response2, err2 := client.GetMlsListingBySource(ctx, request2)
	status2, ok := status.FromError(err2)
	assert.Nil(t, response2)
	assert.True(t, ok)
	assert.NotNil(t, err2)
	assert.Equal(t, fmt.Sprintf("Listings cannot be searched beyond last %v days", conf.Api.BySource.AllowedLastChangeDays), status2.Message()) // should ignore nano's in the error message
	assert.Equal(t, codes.InvalidArgument, status2.Code())

	// 3. update the "lastChangeDate" to return the response.
	filter := &bson.M{"_id": "CABCREIS_490266"}
	update := &bson.M{
		"$currentDate": bson.M{
			"last_change_date": true,
		},
	}
	result, _ := mongodbUpdate(filter, update)
	assert.NotNil(t, result)
	assert.Equal(t, int64(1), result.MatchedCount)
	lastChangeTs3 := time.Now().AddDate(0, 0, -3).UTC() // client sends nano's in the timestamp

	log.Println("lastChangeTs3: ", lastChangeTs3)
	ts := &timestamp.Timestamp{Seconds: lastChangeTs3.Unix(), Nanos: 0}
	request3 := &pb.GetMlsListingsBySourceRequest{SourceSystemKey: "CABCREIS", LastChangeTimestamp: ts}
	response3, err3 := client.GetMlsListingBySource(ctx, request3)
	assert.Nil(t, err3, err3)
	assert.NotNil(t, response3)
	assert.Equal(t, 1, len(response3.MlsListings))
	AssertElementsMatch(t, response3.MlsListings, testListings.MlsListings)
}

