func TestIntegrationSearchMlsListings(t *testing.T) {

	// update mongodb document to make sure there is atleast one listing event to pass this test.
	filter := &bson.M{"_id": "OH_CBR_213002352"}
	update := &bson.M{
		"$currentDate": bson.M{
			"last_change_date": true,
		},
	}
	result, _ := mongodbUpdate(filter, update)
	log.Printf("updated %v document in mongodb to test search mls listings.", result.ModifiedCount)

	// connection to server
	conn, err := grpc.Dial(fmt.Sprintf("localhost:%d", port), grpc.WithInsecure())
	if err != nil {
		log.Fatalf("Unable to connect: %v", err)
	}
	defer conn.Close()
	client := pb.NewMlsListingServiceClient(conn)

	ctx, cancel := context.WithTimeout(context.Background(), time.Second)
	defer cancel()

	// response json
	testListingJson := OH_CBR_213002352
	testListings := &pb.SearchMlsListingsResponse{}
	err1 := jsonpb.Unmarshal(strings.NewReader(testListingJson), testListings)
	assert.Nil(t, err1, err1)

	// 1. isRealogyListing
	request := &pb.SearchMlsListingsRequest{IsRealogyListing: true}
	response, err := client.SearchMlsListings(ctx, request)
	assert.Nil(t, err)
	assert.NotNil(t, response)
	assert.Greater(t, len(response.MlsListings), 0)

	// 2. isLuxuryListing
	request2 := &pb.SearchMlsListingsRequest{IsLuxuryListing: true}
	response2, err2 := client.SearchMlsListings(ctx, request2)
	assert.Nil(t, err2)
	assert.NotNil(t, response2)
	assert.Equal(t, 1, len(response2.MlsListings))
	AssertElementsMatch(t, response2.MlsListings, testListings.MlsListings)

	// 3. isRealogyListing & astChangeTimestamp
	lastChangeTs := time.Now().AddDate(0, 0, -1).UTC().Unix()
	request3 := &pb.SearchMlsListingsRequest{IsRealogyListing: true, LastChangeTimestamp: &timestamp.Timestamp{Seconds: lastChangeTs, Nanos: 0}}
	response3, err3 := client.SearchMlsListings(ctx, request3)
	assert.Nil(t, err3)
	assert.NotNil(t, response3)
	assert.Equal(t, 1, len(response3.MlsListings))
	AssertElementsMatch(t, response3.MlsListings, testListings.MlsListings)

	// 4. No input should not return response. Search must be accompanied by main filters such as isRealogyListing.
	request4 := &pb.SearchMlsListingsRequest{}
	response4, err4 := client.SearchMlsListings(ctx, request4)
	assert.NotNil(t, err4)
	assert.Nil(t, response4)

	// 5. Input only with sub filters such as standardStatus should not return response. Search must be accompanied by main filters such as isRealogyListing.
	request5 := &pb.SearchMlsListingsRequest{StandardStatus: "ACTIVE"}
	response5, err5 := client.SearchMlsListings(ctx, request5)
	assert.NotNil(t, err5)
	assert.Nil(t, response5)

	// 6. Input with only isLuxuryListing should internally search against realogy listings
	request6 := &pb.SearchMlsListingsRequest{IsLuxuryListing: true}
	response6, err6 := client.SearchMlsListings(ctx, request6)
	assert.Nil(t, err6)
	assert.NotNil(t, response6)
	assert.Equal(t, 1, len(response6.MlsListings))

	// 7. API does not support isLuxuryListing=false when isRealogyListing=true. Returns all realogy listings for both luxury and non-luxury.
	request7 := &pb.SearchMlsListingsRequest{IsRealogyListing: true, IsLuxuryListing: false}
	response7, err7 := client.SearchMlsListings(ctx, request7)
	assert.Nil(t, err7)
	assert.NotNil(t, response7)
	assert.Equal(t, 1, len(response7.MlsListings))
}

